import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css';

//React-BS Button, Navbar
import { Button, Navbar, Nav, NavLink, NavDropdown, Form, FormControl } from 'react-bootstrap'
import BookmarkBorderOutlinedIcon from '@material-ui/icons/BookmarkBorderOutlined';
import Switch from '@material-ui/core/Switch';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';

const IOSSwitch = withStyles((theme) => ({
    root: {
        width: 42,
        height: 26,
        padding: 0,
        margin: theme.spacing(1),
    },
    switchBase: {
        padding: 1,
        '&$checked': {
            transform: 'translateX(16px)',
            color: theme.palette.common.white,
            '& + $track': {
                backgroundColor: '#52d869',
                opacity: 1,
                border: 'none',
            },
        },
        '&$focusVisible $thumb': {
            color: '#52d869',
            border: '6px solid #fff',
        },
    },
    thumb: {
        width: 24,
        height: 24,
    },
    track: {
        borderRadius: 26 / 2,
        border: `1px solid ${theme.palette.grey[400]}`,
        backgroundColor: theme.palette.grey[50],
        opacity: 1,
        transition: theme.transitions.create(['background-color', 'border']),
    },
    checked: {},
    focusVisible: {},
}))(({ classes, ...props }) => {
    return (
        <Switch
            focusVisibleClassName={classes.focusVisible}
            disableRipple
            classes={{
                root: classes.root,
                switchBase: classes.switchBase,
                thumb: classes.thumb,
                track: classes.track,
                checked: classes.checked,
            }}
            {...props}
        />
    );
});

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            apiResponse: "",
            switch1: false,
        };
    }

    handleSwitchChange = nr => () => {
        let switchNumber = `switch${nr}`;
        this.setState({
            [switchNumber]: !this.state[switchNumber]
        });
    }

    callAPI() {
        fetch("http://localhost:9000/testAPI")
            .then(res => res.text())
            .then(res => this.setState({ apiResponse: res }))
            .catch(err => err);
    }

    componentDidMount() {
        this.callAPI();
    }

    render() {
        return (
            <Navbar className="navbar" expand="lg">  {/*bg="light" >*/}
                {/*<Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>*/}
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Form inline>
                    <FormControl type="text" placeholder="Enter keyword..." className="mr-sm-2" />
                    <Button variant="outline-success">Search</Button>
                </Form>
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <NavLink href="#home" style={{ color: "#9b9b9b" }} activeStyle={{ color: '#d2d2d4' }}>Home</NavLink>
                        <NavLink href="#link" style={{ color: "#9b9b9b" }} activeStyle={{ color: '#d2d2d4' }}>World</NavLink>
                        <NavLink href="#link" style={{ color: "#9b9b9b" }} activeStyle={{ color: '#d2d2d4' }}>Politics</NavLink>
                        <NavLink href="#link" style={{ color: "#9b9b9b" }} activeStyle={{ color: '#d2d2d4' }}>Business</NavLink>
                        <NavLink href="#link" style={{ color: "#9b9b9b" }} activeStyle={{ color: '#d2d2d4' }}>Technology</NavLink>
                        <NavLink href="#link" style={{ color: "#9b9b9b" }} activeStyle={{ color: '#d2d2d4' }}>Sports</NavLink>

                        {/* <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                        </NavDropdown> */}

                    </Nav>

                    <BookmarkBorderOutlinedIcon style={{ fontSize: 30, color: "#d2d2d4" }} />

                    <text>NYT </text>
                    <FormGroup>
                        <FormControlLabel
                            control={<IOSSwitch checked={this.state.switch1} onChange={this.handleSwitchChange(1)} name="NYTorGuardian" />}
                            label="Guardian"
                        />
                    </FormGroup>

                </Navbar.Collapse>
            </Navbar>
        );
    }
}


export default App;
